	};
	let attBBchiquita = {
		bb: {duration: 5.5, y: -78, ease: 'Circ.easeIn'},
		bbOpacity: {duration: 0.7, opacity: 0},
		sombraV: {duration: 5.48, y: -80, ease: 'Circ.easeIn'}
	};

	

	let burbujaGrande = () => {
		let bbG = gsap.timeline({repeat:-1})
		bbG.to("#bbG", attBBgrande.bb)
		bbG.to("#bbG", attBBgrande.bbOpacity, "6.7")
		bbG.to("#sombrabbG", attBBgrande.sombraV, "0")
		bbG.to("#sombrabbG", attBBgrande.bbOpacity, "6.67")
		return bbG
	}
	let burbujaMediana = () => {
		let bbG = gsap.timeline({repeat:-1})
		bbG.to("#bbMediana", attBBmediana.bb)
		bbG.to("#bbMediana", attBBmediana.bbOpacity, "3.7")
		bbG.to("#sombraMediana", attBBmediana.sombraV, "0")
